import Header from './Header';
import Sidebar from './Sidebar';
function DefaultLayout({ chilrent }) {
    return (
        <div>
            <Header></Header>
            <div className="container">
                <Sidebar></Sidebar>
                <div className="content">{chilrent}</div>
            </div>
        </div>
    );
}

export default DefaultLayout;
